DROP TABLE IF EXISTS `carbon_records`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `carbon_records` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `tree_id` bigint unsigned NOT NULL,
  `estimated_biomass_kg` double(8,2) DEFAULT NULL,
  `carbon_stock_kg` double(8,2) DEFAULT NULL,
  `annual_sequestration_kg` double(8,2) DEFAULT NULL,
  `recorded_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `carbon_records_tree_id_foreign` (`tree_id`),
  CONSTRAINT `carbon_records_tree_id_foreign` FOREIGN KEY (`tree_id`) REFERENCES `trees` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=88 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
